import React from 'react';
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import {
  Navbar,
  Nav,
  // NavItem
} from 'react-bootstrap'
import Home from './Home.js'
import CreateAccount from './CreateAccount.js'

export default class Main extends React.Component {
  render() {
    return (
      <HashRouter>
        <Navbar bg="dark" variant="dark">
          <img
            alt=""
            src={require('./../static/Unite3D-dark.png')}
            width="108.25"
            height="50"
            className="mr-2 d-inline-block align-top"
          />
          <Nav className="mr-auto">
            <NavLink style={{textDecoration: 'none', color: 'inherit'}} to="/">Home</NavLink>
            <NavLink style={{textDecoration: 'none', color: 'inherit'}} to="/create_account">Create Account</NavLink>
          </Nav>
        </Navbar>
        <div className="content">
          <Route exact path="/" component={Home}/>
          <Route path="/create_account" component={CreateAccount}/>
        </div>
      </HashRouter>
    )
  }
}
